INSERT INTO public.interventions (id,boat_id,description,title,date,created_at) VALUES ('7547ddf8-ad05-5c14-8354-2df871f6fa3e', '4e3154f8-cf41-548c-b828-3f67e4bab313', 'His epicullam venire enimurus dis dationes quam a, quidem traditatqui afferendam nis iudicanim est inis.', 'Et praesidita pluribus quidem malum.', '2020-01-21T00:43:06.000Z', DEFAULT), ('c429f34a-f64a-57c1-9860-c9c1edecccb1', '4e3154f8-cf41-548c-b828-3f67e4bab313', 'Sic autemus desis tum vitae quae assidiarit primis, his inem rebus ipsa ad.', 'Viveriores quae magis sitatem vero formavittam, regione se copulla est manusdam quam probaremus.', '2020-01-09T00:27:39.000Z', DEFAULT), ('a7c48d2f-3601-5e8f-b1f4-b1a2f998a010', 'd514a2a9-b3a3-549c-8b0f-275ed0f26451', 'Parantiam esse atque quoniamus ant endi libiditiis hoc.', 'Librisque quidem posse monstret sum occula quam expedita.', '2020-05-25T16:55:55.000Z', DEFAULT), ('e3f5f201-335e-5e45-8c0a-b6eb83720f9b', 'd514a2a9-b3a3-549c-8b0f-275ed0f26451', 'Nam vult dis expectant modicur te sever, parenim magnit et sum idis hocles fuit.', 'Voce detertim exultimar esset voluptate.', '2020-02-26T01:53:38.000Z', DEFAULT), ('01245c2d-ddc6-511b-8300-8a0081fba05f', 'd9ab4294-750c-51da-93fe-b4125401af7a', 'Quaedamarbit quod desis putari voluptatem fore endumve.', 'Iamsi aut naturbane epicura qui salut.', '2020-03-03T02:43:52.000Z', DEFAULT), ('3df6bbe6-78cf-56ea-ae57-a961ebee84c1', 'd9ab4294-750c-51da-93fe-b4125401af7a', 'Homindivid contra sapientesque gessis sententionem est in horum, abo rationum cere tenta nosque aegritum metus quod.', 'Plerum quid nos mors romans doloristem patriam, quod in voluptatib qui physicis inant qua.', '2020-03-23T03:01:55.000Z', DEFAULT), ('73d80be7-535f-5f05-830e-904e4fe9a4ce', '5946d138-6826-52e5-bde3-d55fe3b812ff', 'Ab nihillum vivatum acut repet ut omnis honesse, quae utamicul obliquidae teris philos et.', 'Voluptate it molest viveritur sit, nostrum beatam pariendam quid dolordation etiam ius.', '2020-07-07T18:26:30.000Z', DEFAULT), ('d3e983ad-54b5-50fe-a9b7-5603de3d5bb0', '5946d138-6826-52e5-bde3-d55fe3b812ff', 'Est ratione itur credo quaerenime os aut etiam.', 'Potentur nam quod eo antium praetullus viderit, itionis et albamur non modis.', '2020-11-15T22:51:15.000Z', DEFAULT);
INSERT INTO public.equipments (id,name,description,purchase_value,purchase_date,created_at,boat_id,system_key,brand,model,serial_number,warranty_end_date) VALUES ('edee9c7f-af19-5e81-aca8-7e415ac7ca20', 'Scriberrore vel sequat negantur comparate contra, dolenim voluptat multis tamenimpet quorum.', 'Chaere modo voluptate dicassensib nihilisse, cuiquamus volundum solut exedicur et ratione.', 7.530521696859274, '2020-10-10T09:45:10.000Z', DEFAULT, '4e3154f8-cf41-548c-b828-3f67e4bab313', 'Sit stultus tempus iucundit as.', 'Ut iis instituitat asperpetul facita etura nam filium, aliens viverita et ilius legunde andri ratu multis.', 'Pro modo is interire praeterius vivendum quis.', 'Ipsam et commemindoc laetam quid, suis hominum inesse bonum us moles didere aut.', '2020-04-20T15:52:43.000Z'), ('1cc836f6-467a-54b8-9d91-c1edc8e60ab9', 'Ipsius tum iudicit victi ercitus feratesse romanime si, monitur horribilit dolorus de orum es nostri.', 'Eo sic it quidem tibus c bonae, inventore ipsum veniuntque ime mihi censes idem.', 4.9474262140686305, '2020-08-20T19:18:10.000Z', DEFAULT, '4e3154f8-cf41-548c-b828-3f67e4bab313', 'Locostenda denique aliquisset nec quos ne.', 'Quid deditarem securus mors comprehenter provideren cum detractis, si quod ilium conectis quoque bonorum.', 'Facio am qui sapiendum cum.', 'Ipsam tamque en quod sum suppetenta epicureis non.', '2020-08-16T07:32:12.000Z'), ('2d014aee-80ca-5793-8490-f6451d4720d1', 'Quae nullo qua teras redeam.', 'Omnium uti et cum ipsa dolore sit quibus, perciplinae deinde bonum dis multos beate.', 10.55149201203672, '2020-06-22T17:51:09.000Z', DEFAULT, 'd514a2a9-b3a3-549c-8b0f-275ed0f26451', 'Quas sit studiisque autem mundustriae quietem videm, labitia cur possit aegritum abunt placeatural saepti.', 'Amet et libenda nunc architecto docet, ipsam progreddido non hominpenden sine entur non voluptation.', 'Neque de qui pronunde graecisque, quidem torem quam paene declina quo secut es.', 'Affecis prohibus vitiis statueruna interis et utris.', '2020-01-09T13:01:26.000Z'), ('fb30dc41-b87c-5712-a822-6a5ee9bc2ae7', 'Falsi in inquamquam et quam, maledunt quo medium etur ob ute ex patrius.', 'Quam nec esse iliae quo monetur intelleger.', 6.89492316635438, '2020-06-10T05:12:23.000Z', DEFAULT, 'd514a2a9-b3a3-549c-8b0f-275ed0f26451', 'Ego summum nota placetiam locum de arenimi, est declinguam quidem sic inemus.', 'Rerumque laudatumque aetatione mediocrium eturum ante liberius ea.', 'Quam natur molessariae illa ea.', 'Si quidem provinum caeco ut brute referavis quibus, non et ipsos dicamari quaerit.', '2020-07-07T18:44:41.000Z'), ('eda59a9c-6fc2-590d-a8aa-87697c38a0e3', 'Docenim et multi si summum.', 'Velimporis loquerunt hoc et quidem tum ei.', 7.840182356065557, '2020-05-17T04:29:05.000Z', DEFAULT, 'd9ab4294-750c-51da-93fe-b4125401af7a', 'Sed percipio aliosum philos al aut.', 'Quidem sed arens epicet non, saepe ut nec maluisti se.', 'Ati sive int platone fugienus ad, affecer ut mihi ordam quidem paene.', 'Quibus maiestatibus quo quam intereantur mediocrem, qui nullam voluptatem opibusdam praetere omi gratia loque.', '2020-03-15T02:25:33.000Z'), ('52ce1b58-5088-5ef9-8776-e52b41b3d02a', 'Consequeret de collaudab scribi ad vituptatem et multi.', 'Melius viderunt bonum sale quisitation et, quae probes tamenimped orem ex quorum vis dolorum.', 0.47491365838390115, '2020-08-12T07:42:58.000Z', DEFAULT, 'd9ab4294-750c-51da-93fe-b4125401af7a', 'Meo afferent nulli tum quidem si.', 'Linatomne solenda torest ensa dubit, etendam accessione amur rebus esse.', 'Quam ad etur laudanimprob natura posse videnimi id, cum alliciatur minare et soliderin e.', 'Loca ear ut verum ut autem, quam amicium sed aret vim probata iditus.', '2020-02-22T01:59:16.000Z'), ('e9ba8384-9203-508b-9728-331e2550c147', 'Et a dolore firmiserruis possentener quae vacare ex, in vos quod et quis.', 'Et falsi vias etiam ut non in ipso, aut voluptas cordia falsariae ait.', 1.5322183051356577, '2020-10-14T09:53:58.000Z', DEFAULT, '5946d138-6826-52e5-bde3-d55fe3b812ff', 'Dictumcum voluptates progrediens et necest rediens, ab parte issimam sint videtiam.', 'Maluis multo imeque illa assidiarem non ne, retin sine sus contentus dolorus es faciendissid ne.', 'Incias entibus hic quaeri hominerri.', 'Qui delectatem et philosophor eadem quae et.', '2020-07-07T18:22:33.000Z'), ('d8bedb88-0ac9-545f-8b81-b5a3edfdc31d', 'Apte ut ideret tota primum et quis.', 'Actet quidem rebus cuiquamur amicur ini longinquit voluptas, attentia etiam torquatis inimi de.', 4.728658690966845, '2020-10-06T22:05:29.000Z', DEFAULT, '5946d138-6826-52e5-bde3-d55fe3b812ff', 'Metu iudicita quia ea degendi qui dicta, epicaret mirarte cum enimis sed tractavitat quasi admiraret.', 'Esse reprehenim provocuri dicerunt de ruinae autem, quantum inem legimo voluptatis sit.', 'Dicam vivamputar hoc philosopes quas a.', 'Nulla nam numquam tempertiner aut utata nostrum, non quasi eventa nivem possunt.', '2020-05-13T16:52:34.000Z');
